import React from "react";
import styled from "styled-components";

const Span = styled.span`
  color: blue;
`;

const ModalTypr = () => {
  return (
    <Container>
      <Container1>
        <Span>hello</Span>
      </Container1>
      <Container2 />
    </Container>
  );
};

export default TyprModal;
